svg.script:
		function init(evt) {
			if ( window.svgDocument == null ){
				svgDocument = evt.target.ownerDocument;

				svgDocument.updateErrorCode = function (code) {
					document.getElementById('error-code').children[0].textContent = code;
				};

				svgDocument.updateErrorMessage = function (msg1, msg2) {
					document.getElementById('error-message').children[0].children[0].textContent = msg1;
					
					if (msg2.length > 40) {
						msg2 = msg2.substring(0,39) + "...";
					}
					document.getElementById('error-message').children[0].children[1].textContent = msg2;
				};
		
			}
		}
